import React, { useState } from 'react';
import { uploadMemory } from './api';

function MemoryUploader() {
    const [file, setFile] = useState(null);
    const [title, setTitle] = useState('');
    const [message, setMessage] = useState('');
    const [error, setError] = useState('');
    const [loading, setLoading] = useState(false);

    const handleUpload = async () => {
        setMessage('');
        setError('');

        if (!file) {
            setError('Please select a file.');
            return;
        }

        if (!title.trim()) {
            setError('Please enter a memory title.');
            return;
        }

        setLoading(true);
        try {
            const timestamp = new Date().toISOString();
            const formData = new FormData();
            formData.append('file', file);
            formData.append('title', title);
            formData.append('timestamp', timestamp);

            const result = await uploadMemory(formData);
            setMessage(result.message || `"${title}" uploaded successfully at ${new Date(timestamp).toLocaleString()}!`);
            setTitle('');
            setFile(null);
        } catch (err) {
            setError('Upload failed. Please try again.');
        }
        setLoading(false);
    };

    return (
        <div style={styles.container}>
            <h2 style={styles.header}>🚀 Upload Memory</h2>

            <div style={styles.formGroup}>
                <label style={styles.label}>📝 Title</label>
                <input
                    type="text"
                    value={title}
                    onChange={(e) => setTitle(e.target.value)}
                    placeholder="e.g., Birthday at Beach"
                    style={styles.input}
                    disabled={loading}
                />
            </div>

            <div style={styles.formGroup}>
                <label style={styles.label}>📁 Select File</label>
                <div style={styles.fileInputWrapper}>
                    <label style={styles.fileLabel}>
                        Choose File
                        <input
                            type="file"
                            onChange={(e) => setFile(e.target.files[0])}
                            style={styles.hiddenFileInput}
                            disabled={loading}
                        />
                    </label>
                    {file && (
                        <div style={styles.fileInfo}>
                            <span style={styles.fileName}>{file.name}</span>
                            <span style={styles.fileSize}>
                                {(file.size / 1024 / 1024).toFixed(2)} MB
                            </span>
                        </div>
                    )}
                </div>
            </div>

            <button onClick={handleUpload} style={styles.button} disabled={loading}>
                {loading ? (
                    <div style={styles.loading}>
                        <div style={styles.spinner}></div>
                        Uploading...
                    </div>
                ) : '📤 Upload Memory'}
            </button>

            {message && <p style={styles.success}>{message}</p>}
            {error && <p style={styles.error}>{error}</p>}
        </div>
    );
}

const styles = {
    container: {
        maxWidth: '500px',
        margin: '40px auto',
        padding: '25px',
        borderRadius: '16px',
        background: 'linear-gradient(145deg, rgba(15,12,36,0.9), rgba(30,20,70,0.9))',
        border: '1px solid rgba(130,100,250,0.3)',
        boxShadow: '0 8px 30px rgba(0,0,0,0.4)',
        color: '#e0e0ff',
        fontFamily: 'Segoe UI, sans-serif',
    },
    header: {
        fontSize: '1.8rem',
        textAlign: 'center',
        background: 'linear-gradient(90deg, #8b5cf6, #4f46e5)',
        WebkitBackgroundClip: 'text',
        WebkitTextFillColor: 'transparent',
        marginBottom: '25px',
    },
    formGroup: {
        marginBottom: '20px',
    },
    label: {
        display: 'block',
        marginBottom: '8px',
        fontWeight: '500',
        color: '#bcbcff',
    },
    input: {
        width: '100%',
        padding: '12px',
        borderRadius: '10px',
        background: 'rgba(255,255,255,0.05)',
        border: '1px solid rgba(130,100,250,0.3)',
        color: '#fff',
        fontSize: '1rem',
        outline: 'none',
    },
    fileInputWrapper: {
        position: 'relative',
    },
    fileLabel: {
        display: 'inline-block',
        padding: '10px 20px',
        background: 'linear-gradient(90deg, #4f46e5, #8b5cf6)',
        borderRadius: '8px',
        color: 'white',
        fontWeight: '600',
        cursor: 'pointer',
        transition: 'transform 0.2s ease',
    },
    hiddenFileInput: {
        display: 'none',
    },
    fileInfo: {
        marginTop: '10px',
        padding: '10px',
        background: 'rgba(255,255,255,0.05)',
        borderRadius: '8px',
        display: 'flex',
        justifyContent: 'space-between',
        fontSize: '0.9rem',
    },
    fileName: {
        color: '#e0e0ff',
        maxWidth: '70%',
        overflow: 'hidden',
        textOverflow: 'ellipsis',
        whiteSpace: 'nowrap',
    },
    fileSize: {
        color: '#8a7fff',
    },
    button: {
        width: '100%',
        padding: '14px',
        background: 'linear-gradient(90deg, #6366f1, #8b5cf6)',
        color: 'white',
        border: 'none',
        borderRadius: '10px',
        fontSize: '1rem',
        fontWeight: '600',
        cursor: 'pointer',
        transition: 'all 0.3s ease',
    },
    loading: {
        display: 'flex',
        alignItems: 'center',
        justifyContent: 'center',
        gap: '10px',
    },
    spinner: {
        width: '16px',
        height: '16px',
        border: '3px solid rgba(255, 255, 255, 0.3)',
        borderTop: '3px solid white',
        borderRadius: '50%',
        animation: 'spin 1s linear infinite',
    },
    success: {
        color: '#4ade80',
        backgroundColor: 'rgba(74,222,128,0.1)',
        padding: '10px 15px',
        borderRadius: '8px',
        marginTop: '15px',
        borderLeft: '4px solid #4ade80',
    },
    error: {
        color: '#f87171',
        backgroundColor: 'rgba(248,113,113,0.1)',
        padding: '10px 15px',
        borderRadius: '8px',
        marginTop: '15px',
        borderLeft: '4px solid #f87171',
    },
};

// Add keyframe to the global style tag since React inline styles can't handle it
const styleSheet = document.styleSheets[0];
if (styleSheet && styleSheet.insertRule) {
    styleSheet.insertRule(`
        @keyframes spin {
            from { transform: rotate(0deg); }
            to { transform: rotate(360deg); }
        }
    `, styleSheet.cssRules.length);
}

export default MemoryUploader;
